import { Card, Button } from "./ui/card";
export function AnalyticsTab() {
  const dataSet = [
    {
      station: "Outpatient Stations",
      substations: [
        "Testicular Lump",
        "Raised PSA",
        "Haematuria",
        "Renal mass",
        "OAB",
      ],
    },
    {
      station: "Emergency Station",
      substations: ["AUR", "Renal colic", "Haematuria"],
    },
  ];
  return (
    <div>
      <Card>
        <h1>Urology Interview</h1>

        {dataSet.map((data)=> (
            <div>
            <h2>{data.station}</h2>
            {data.substations.map((substation))}
            <Button></Button>
            </div>
        ))}
      </Card>
    </div>
  );
}
